import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import React, { Component } from "react";
import News from "../NewsComponent/News";
import Slider from "react-slick";

export default class Carousel extends Component {
  render() {
    const settings = {
      dots: true,
      infinite: true,
      //autoplay: true,
      speed: 500,
      slidesToShow: 3,
      slidesToScroll: 3,
      appendDots: (dots) => (
        <div
          style={{
            backgroundColor: "#ddd",
            borderRadius: "10px",
            padding: "10px",
          }}
        >
          <ul style={{ margin: "0px" }}> {dots} </ul>
        </div>
      ),
    };
    return (
      <div>
        <Slider {...settings}>
          <div>
            <News />
          </div>
          <div>
            <News />
          </div>
          <div>
            <News />
          </div>
          <div>
            <News />
          </div>
          <div>
            <News />
          </div>
          <div>
            <News />
          </div>
          <div>
            <News />
          </div>
          <div>
            <News />
          </div>
          <div>
            <News />
          </div>
        </Slider>
      </div>
    );
  }
}
